import React from 'react'
import Project from './Project'

//import projectsData from './projectsData'

function MyWork () {
    
    const projectsData = [
    {
        id: "1",
        title: "Simon",
    },
    {
        id: "2",
        title: "Annika",
    }
]
    const myProjects = projectsData.map(item => <Project key={project.id} project={item}/>)
    
    //const myProjects = projectsData.map(project => <Project id={project.id} title={project.title}/>)
        
    const num = [1, 2, 4 ,5]
    const newArray = num.map(function(num){
        return num * 2
    })
    
    const textStyle = {
        textAlign: 'center',
        color:'black'
    }
    return (
        <div>
            <h1 style={textStyle}>My Work</h1>
            <div class="projects" style={textStyle}>
                <h1>{newArray}</h1>
                {myProjects} 
            </div>
        </div>
    ) 
}

export default MyWork
